import { ListGroup } from 'react-bootstrap';

export default function Categorias(props)  {
    return (
        <ListGroup variant="flush" className= "categoria">
            <ListGroup.Item action variant="light">Mostrar tudo</ListGroup.Item>
            <ListGroup.Item action variant="light">{props.categoria}</ListGroup.Item>
            <ListGroup.Item action variant="light">Fogões</ListGroup.Item>
            <ListGroup.Item action variant="light">Micro-ondas</ListGroup.Item>
            <ListGroup.Item action variant="light">Lavadoras de roupas</ListGroup.Item>
            <ListGroup.Item action variant="light">Lava-louças</ListGroup.Item>
        </ListGroup>
    )
}
